import InternalLayout from '../components/InternalLayout';
import TableTemplate from '../components/TableTemplate';
import ModalLayout from '../components/ModalLayout';
import {useEffect,useState} from 'react';
import axios from 'axios';

export default (props) => {
    const loadingData =[{
        id: 0,
        dogName:'Loading',
        dogAge: '',
        dogBreed: '',
        dogGender: '',
        ownerInfo:<></>,
        foodInfo:'',
        fixed: '',
        vetInfo:''
    }];
    const [data,setData] = useState(loadingData);
    const ownerInfo = (text,rowData)=>{ return <>
        <p>{`Name: ${rowData.ownerFirstName} ${rowData.ownerLastName}`}</p>
        <p>{`Phone: ${rowData.ownerCellPhone}`}</p>
        <p>{`Email: ${rowData.ownerEmail}`}</p>
    </>}
    const createTableData = (array)=>{
        setData( array.map(object=>{
            return ({
                id: object.id,
                dogName: object.dogName,
                dogAge: object.dogAge,
                dogBreed: object.dogBreed,
                dogGender: object.dogGender,
                ownerInfo: '',
                foodInfo: '',
                fixed: object.fixed,
                vetInfo: ''
            });
        }));
    }
    useEffect(() => {
        axios.get('/api/form')
        .then(res => {
            createTableData(res.data);
        })
        .catch(err => console.log('Error:',err))
    },[]);
    console.log(data)
    let headerData = [{
        tableHeaderName:'dogName',
        name: 'Dog Name',
        clickFunction: '',
        haschildren: false,
        children: ''
    },
    {
        tableHeaderName:'dogAge',
        name: 'Age',
        clickFunction: '',
        haschildren: false,
        children: ''
    },
    {
        tableHeaderName:'dogBreed',
        name: 'Breed',
        clickFunction: '',
        haschildren: false,
        children: ''
    },
    {
        tableHeaderName:'dogGender',
        name: 'Gender',
        clickFunction: '',
        haschildren: false,
        children: ''
    },
    {
        tableHeaderName:'ownerInfo',
        name: 'Owner Contact Information',
        clickFunction: '',
        haschildren: true,
        children: ownerInfo
    },
    {
        tableHeaderName:'foodInfo',
        name: 'Food Information',
        clickFunction: '',
        haschildren: false,
        children: ''
    },
    {
        tableHeaderName:'fixed',
        name: 'Fixed',
        clickFunction: '',
        haschildren: false,
        children: ''
    },
    {
        tableHeaderName:'vetInfo',
        name: 'Veterinarian Information',
        clickFunction: '',
        haschildren: false,
        children: ''
    },
    {
        tableHeaderName:'status',
        name: 'Status',
        clickFunction: '',
        haschildren: false,
        children: ''
    }]

    let tempdata = [{
        dogName:'Bailey',
        dogAge: 7,
        dogBreed: 'Rhodesian Ridgeback',
        dogGender: 'female',
        ownerInfo:`name: Maria Tripoli
        phone: 13214310659
        email: meatripoli@gmail.com`,
        foodInfo:`name: Nature's Logic Sardine flavor
        amount: 4
        time: Morning and Evening`,
        fixed: 'yes',
        vetInfo:`name: Parmer Lane Pet Hospital
        phone: 512-260-5443`,
        status: 'Boarding'

    }];
    return <>
        <InternalLayout adminFlag='y'>
            <TableTemplate header={headerData} table={tempdata}>
            </TableTemplate>
        </InternalLayout>
        </>
}
